const fetch = require('node-fetch');       

function Inserta(query,cb) {
    return fetch(`http://localhost/api/inserta?q=${query}`,{method: 'POST'})
         .then(res => res.text())
         .then(cb);
   }
  
const ClientInserta = { Inserta };
export default ClientInserta;
